import React, {Component} from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

export default class CryptoList extends Component{
    constructor(propos){
        super(props);

    }
    componentDidMount(){
        axios.get('http://localhost:5000/crypto/')
        .then(response =>{
            this.setState({ crypto: response.data})
        })
        .catch((error)=>{
            console.log(error);
        })
    }

    render(){
        return(
            <div>
                <h2>Crypto Currency Historial</h2>
                <table className="table">
                    <thread className="thread-light">
                        <tr>
                            <th>Currency</th>
                            <th>Date</th>
                            <th>Open</th>
                            <th>High</th>
                            <th>Low</th>
                            <th>Volume</th>
                            <th>Market Cap</th>
                        </tr>
                    </thread>
                </table>
            </div>
        )
    }
}
